import React from "react";
import "./RecipeExtraInfo.css";
import ExtraInfo from "../extraInfo/ExtraInfo";
import ExtraLink from "../extraLink/ExtraLink";

export default function RecipeExtraInfo() {
  return (
    <div className="recipe-extra-info">
      <ExtraInfo />
      <ExtraLink />
      <div className="important-info inline-block">
        <h2 className="extra-info-header">Who we are?</h2>
        <p className="extra-info-text">
          Sousmate exists 10 years. We have 1 million subscribers and more than
          100 employees.
        </p>
      </div>
    </div>
  );
}
